import React from 'react';
import Home from './Home.js'
import { Navbar, NavItem } from 'react-materialize';
import './App.css';

class App extends React.Component {
  render(){
  return (
    <div className="App">
     <Navbar brand={<a />} alignLinks="right">
            <NavItem href="/About">
            About
            </NavItem>
            <NavItem href="/Projects">
            Projects
            </NavItem>

            </Navbar>
     <Home/>
    </div>
  );
  }
}

export default App;
